import React from 'react';
import styled from 'styled-components';

const ChattingInputBlock = styled.div`
  width: 100%;
  height: 50px;
`;
const ChattingArea = styled.textarea`
  resize: none;
  height: 100%;
  border: none;
`;

const ChattingInput = () => {
  return (
    <ChattingInputBlock>
      <ChattingArea />
    </ChattingInputBlock>
  );
};

export default ChattingInput;
